script: |
  super -f text -I q10732.spq | sort > q10732.out

inputs:
  - name: q10732.spq
    data: |
      SELECT - + 93 + - + CAST ( NULL AS INTEGER ) * + + 64 + - 93, - col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT - col2 NOT BETWEEN + col2 AND + col2 * + + 66;
  - name: tab2

outputs:
  - name: q10732.out
    data: |
